import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Home = () => {
    const [personas, setPersonas] = useState([]);
    const [error, setError] = useState('');

    useEffect(() => {
        loadPersonas();
    }, []);

    const loadPersonas = async () => {
        const token = localStorage.getItem('token'); // Asegúrate de tener el token guardado
        const apiKey = ''; // Si necesitas la API Key, debes obtenerla aquí

        try {
            const response = await axios.get('http://localhost:9001/Laboratorio1/personas', {
                headers: {
                    Authorization: `Bearer ${token}`,
                    apikey: apiKey
                }
            });
            setPersonas(response.data);
        } catch (error) {
            console.error('Error loading personas:', error);
            setError('Error al cargar las personas');
        }
    };

    return (
        <div className="container mt-5">
            <h2>Lista de Personas</h2>
            {error && <div className="alert alert-danger">{error}</div>}
            <table className="table">
                <thead>
                    <tr>
                        <th>Nombre</th>
                        <th>Apellido</th>
                        <th>Edad</th>
                        <th>Ubicación</th>
                    </tr>
                </thead>
                <tbody>
                    {personas.map(persona => (
                        <tr key={persona.id}>
                            <td>{persona.primerNombre}</td>
                            <td>{persona.primerApellido}</td>
                            <td>{persona.edad}</td>
                            <td>{persona.ubicacion}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Home;
